  const title = match.split("|")[0];
  const chapter = match.split("|")[1];

  dbDatas.filter((data) => data.title === title && console.log("data", data));

  return (
    <section className={st.note}>
      {dbDatas.filter(
        (data) => data.title === title && <div>{data.title}</div>
      )}
    </section>
  );
};

export default Note;
